import React from "react";
import Separator from "../components/Separator";
import Title from "../components/Title";
import ConsejoView from "../components/ConsejoView";
import styled from "styled-components";
import Collapsible from "./Collapsible";

const Reference = styled.p`
  display: block;
  width: 100%;
  font-size: 12px;
  color: var(--dark-grey);
  text-decoration: none;
  font-style: italic;

  @media screen and (min-width: 1024px) {
    font-size: 16px;
  }
`;

const TablaAcuerdos = () => {
  // Datos de ejemplo, deberías cargarlos desde tu archivo JSON
  const data = [
    { id: 1, dato1: "Valor 1-1", dato2: "Valor 1-2" },
    { id: 2, dato1: "Valor 2-1", dato2: "Valor 2-2" },
  ];

  return (
    <table>
      <thead>
        <tr>
          <th>Dato 1</th>
          <th>Dato 2</th>
        </tr>
      </thead>
      <tbody>
        {data.map((item) => (
          <tr key={item.id}>
            <td>{item.dato1}</td>
            <td>{item.dato2}</td>
          </tr>
        ))}
      </tbody>
    </table>
  );
};

const ConsejosEstatales = () => {
  return (
    <>
      <Title isHeader>Consejos Estatales Forestales</Title>
      <Separator />
      <Reference>
        Seleccione el estado del que desee visualizar información.
      </Reference>
      <ConsejoView />

      <Collapsible title={"Informe de acuerdos"}>
        {/* Contenido para el año 2023 */}
        <Collapsible title={2023}>
          <TablaAcuerdos />
        </Collapsible>

        {/* Contenido para el año 2024 */}
        <Collapsible title={2024}>
          <TablaAcuerdos />
        </Collapsible>
      </Collapsible>
    </>
  );
};

export default ConsejosEstatales;
